index.addDoc({"lunr_id":551,"link":"{{ site.baseurl }}/en/involved.html","title":"Get Involved","content":" Students and photographers interested in getting involved with the historical photography archive should contact us at or via Whatsapp at +249904696503. We have a need for students and researchers trained in archival practices. Those with previous experience or interested in acquiring such experience are encouraged to contact us to get involved in volunteering for the archive. We will be arranging workshops for volunteers in the coming months, in which volunteers will learn the procedures for ethical research, as well as the practices for digitization and recording data. Photographers interested in volunteering with the archive are also strongly encouraged to contact us. We are particularly in need of photographers with experience cleaning and restoring negatives. In addition to participating the the trainings with other volunteers, photographers will be able to help in the restoration process for negatives. "}); 
