index.addDoc({"lunr_id":553,"link":"{{ site.baseurl }}/en/photos.html","title":"Photographs","content":" The photographs below all come from archive collections that can be viewed in full in the offices of Khartoum University‚Äôs History Department, Faculty of Arts. They have been selected because they show different aspects of Sudanese history, including the beginnings of Khartoum University, activities of Sufi orders, prominent politicians, musicians, athletes, and daily life from the 1950s and 60s. In the process, they illustrate the diversity of Sudanese life in the period of early independence. ## Metadata only: {{ meta_only.size }} "}); 
